import React, { useState } from "react";
import styled from "styled-components";
import { RowView, RowView2 } from "./commom_style";

const ModalBox = styled(RowView)`
  position: absolute;
  bottom: 0;
  width: 100%;
  max-width: 20rem;
  padding: 0.5rem 1rem;
  margin-bottom: 1rem;
  background-color: #10101dd6;
  border-radius: 8px;
`;
const Btn = styled.div`
  padding: 0.2rem 0.5rem;
  margin-left: 0.5rem;
  color: gray
  background-color: #4b4f63;
  border-radius: 5px;
  &.del {
    background-color: tomato;
  }
`;

const Del_Modal = (props) => {
  const selectNum = props.selectNum;

  return (
    <ModalBox>
      <div>정말 삭제하시겠습니까?</div>

      <RowView2>
        <Btn className="del">삭제</Btn>
        <Btn>취소</Btn>
      </RowView2>
    </ModalBox>
  );
};

export default Del_Modal;
